css:
#box {
    display:flex;
    width:100%;
    background-color:#000000;
}
.mini {
    width:calc(100%/5);
    height:80px;
    object-fit: cover;
    display: block;
    transition:1s all;
}
.mini.active {
    transform: scale(0.9);
    opacity:0.9;
}
#grand {
    width:100%;
    height:300px;
    object-fit: cover;
}

