var lierJS = function (selection, evenement, codeJS) {
    var tabSel = document.querySelectorAll(selection);
    for(sel of tabSel) {
        sel.addEventListener(evenement, codeJS);
    }
}

setInterval(function(){
    var active = document.querySelector(".active");
    active.classList.remove("active");
    var next = active.nextElementSibling;
    if (!next) 
        next = document.querySelector(".mini");
    next.classList.add("active");
    grand.src = next.src; 
        
